  return (
    <div className='container'>
        
        <Sidebar />
          <Switch>
            <Route exact path='/mainpage'>
            </Route>
            <Route  path = '/mainpage/Home'>
                <Contente />
            </Route>
          </Switch>
        
        
      </div>
      
  )
}

export default Mainpage
